import styled from "styled-components"

const Wrapper = styled.div`
margin: 0;
padding: 0;

h1{
	text-align: center;
}
`

function App() {
  return (
    <Wrapper>
      <h1>Image Gallery</h1>
    </Wrapper>
  );
}

export default App;
